import{_ as a,c as d,o as t,a6 as e}from"./chunks/framework.CrBHAFc5.js";const u=JSON.parse('{"title":"准备工作","description":"","frontmatter":{},"headers":[],"relativePath":"docs/guide/quickstart/准备工作.md","filePath":"docs/guide/quickstart/准备工作.md","lastUpdated":1715245369000}'),p={name:"docs/guide/quickstart/准备工作.md"},o=e('<h1 id="准备工作" tabindex="-1">准备工作 <a class="header-anchor" href="#准备工作" aria-label="Permalink to &quot;准备工作&quot;">​</a></h1><h2 id="注册开发者账号" tabindex="-1">注册开发者账号 <a class="header-anchor" href="#注册开发者账号" aria-label="Permalink to &quot;注册开发者账号&quot;">​</a></h2><p>首先，你需要注册一个开发者账号，并登录到开发者后台。</p><h2 id="创建应用" tabindex="-1">创建应用 <a class="header-anchor" href="#创建应用" aria-label="Permalink to &quot;创建应用&quot;">​</a></h2><p>登录开发者后台后，点击左侧导航栏中的“应用”，然后点击“创建应用”按钮。</p><p><img src="https://main.qcloudimg.com/raw/d0a7d5d5d5d5d5d5d5d5d5d5d5d5d5d5.png" alt="创建应用"></p><p>在弹出的“创建应用”对话框中，填写应用名称、应用描述、应用回调地址、应用分类、应用logo等信息，然后点击“创建”按钮。</p><p><img src="https://main.qcloudimg.com/raw/d0a7d5d5d5d5d5d5.png" alt="创建应用对话框"></p><p>创建成功后，你将看到应用的基本信息。</p><p><img src="https://main.qcloudimg.com/raw/d0a7d5d5.png" alt="应用基本信息"></p><h2 id="创建密钥" tabindex="-1">创建密钥 <a class="header-anchor" href="#创建密钥" aria-label="Permalink to &quot;创建密钥&quot;">​</a></h2><p>应用创建成功后，你需要创建应用密钥，用于身份验证。</p><p>点击左侧导航栏中的“密钥”，然后点击“创建密钥”按钮。</p><p><img src="https://main.qcloudimg.com/raw/d0a7d5d5d5d5d5d5.png" alt="创建密钥"></p><p>在弹出的“创建密钥”对话框中，填写密钥名称、密钥描述、密钥有效期等信息，然后点击“创建”按钮。</p><p><img src="https://main.qcloudimg.com/raw/d0a7d5d5d5d5d5d5.png" alt="创建密钥对话框"></p><p>创建成功后，你将看到密钥的基本信息。</p><p><img src="https://main.qcloudimg.com/raw/d0a7d5d5.png" alt="密钥基本信息"></p><p>记下密钥的“AppID”和“AppKey”，后续使用时需要用到。</p>',19),r=[o];function i(c,s,n,l,m,h){return t(),d("div",null,r)}const g=a(p,[["render",i]]);export{u as __pageData,g as default};
